ドーム型のフタで、"ふわっと"ご飯やおかずが<br>
詰められるので、おいしさＵＰ♪<br><br>
☆ランチケース版のまるでマトリョーシカ？！<br>
３サイズのランチケースが入れ子式に収納できるので<br>とってもコンパクト☆彡<br><br>
フタを外して電子レンジＯＫ！！ (^O^)v<br>
<br>
◇Ｌ：容量５４０ml、サイズ151×105×54mm<br>
◆Ｍ：容量３５０ml、サイズ140× 93×47mm<br>
◇Ｓ：容量２３０ml、サイズ128× 83×38mm<br>
<br>
≪品質表示≫<br>
・フタ：ＥＶＡ樹脂／耐熱温度60度<br>
・本体：ポリプロピレン／耐熱温度140度<br>
<br>
※食洗機のご使用はしないで下さい。<br>
　変形・破損の原因となります。 (＞_＜)ｂ゛NG!!
<br><br>
<br>【Made in Japan】<BR>

