俵型おにぎり押し型付きの便利なお弁当箱です。<BR>
上段・下段とも小分けができる仕切り付き！！<BR>
食事後は入れ子式でコンパクト収納可能です。<BR>
■容量：上段２８０ml　下段３６０ml<BR>
■サイズ：約８０×１６２×８５ｍｍ<br>
<br>
※電子レンジにはお使い頂けません。<br>
<br>
≪品質表示≫<br>
・フタ、本体：ＡＢＳ樹脂／耐熱温度80度<br>
・仕切り：ポリプロピレン／耐熱温度140度<br>
・シールブタ：ＥＶＡ樹脂／耐熱温度60度<br>
・押し型：ポリプロピレン／耐熱温度140度<br>
・パッキン；シリコン樹脂／耐熱温度140度<br>
・ランチベルト：天然ゴム<br>
<br>【Made in Japan】<BR>

